import Eyeballs from "@/components/Eyeballs";

import styles from "./style.module.scss";

const TreeEyes = ({ color = "cream" }) => {
  return (
    <div className={styles.tree} data-type="tree">
      <TreeSVG color={color} />
      <div className={styles.eyes} data-type="eyes-wrap">
        <Eyeballs color={"forest"} />
      </div>
    </div>
  );
};

const Stump = ({ color = "cream" }) => {
  return (
    <div className={styles.stump} data-type="stump">
      <StumpyStumpSVG color={color} />
    </div>
  );
};

const Plank = ({ color = "cream" }) => {
  return (
    <div className={styles.plank}>
      <StumpyPlankSVG color={color} />
    </div>
  );
};

const Tree = ({ color = "cream" }) => {
  return (
    <div className={styles.tree} data-type="stump">
      <StumpyTreeSVG color={color} />
    </div>
  );
};

export default function Stumpy({ type, color }) {
  switch (type) {
    case "tree":
      return <Tree color={color} />;
    case "stump":
      return <Stump color={color} />;
    case "plank":
      return <Plank color={color} />;
    case "treeEyes":
      return <TreeEyes color={color} />;
  }
}

